import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { CircularProgressbar, buildStyles } from 'react-circular-progressbar';
import 'react-circular-progressbar/dist/styles.css';
import { FaTasks, FaUsers, FaBars } from 'react-icons/fa';

const AdminDashboard = () => {
  const navigate = useNavigate();
  const [showSidebar, setShowSidebar] = useState(false);

  // Dummy data
  const analytics = {
    pendingTasks: 12,
    scheduledTasks: 8,
    completedTasks: 22,
    totalTasks: 42,
  };

  const handleSidebarToggle = () => {
    setShowSidebar(!showSidebar);
  };

  const handleNavigation = (path) => {
    navigate(path);
  };

  return (
    <div className="flex">
      <aside className={`fixed top-0 left-0 h-full bg-gray-800 text-white ${showSidebar ? 'w-64' : 'w-0'} transition-width duration-300`}>
        <div className="p-4">
          <div className="text-2xl mb-4 flex items-center cursor-pointer" onClick={handleSidebarToggle}>
            <FaBars />
          </div>
          <div className="space-y-4">
            <button onClick={() => handleNavigation('/admindashboard')} className="w-full text-left p-2 hover:bg-gray-700 rounded">
              <FaTasks /> Tasks
            </button>
            <button className="w-full text-left p-2 hover:bg-gray-700 rounded">
              <FaUsers /> Users
            </button>
          </div>
        </div>
      </aside>
      <div className={`flex-1 p-4 ml-${showSidebar ? '64' : '0'} transition-margin duration-300`}>
        <h1 className="text-3xl font-bold mb-6">Admin Dashboard</h1>
        <div className="grid grid-cols-2 gap-4">
          <div className="flex items-center justify-center">
            <CircularProgressbar
              value={(analytics.pendingTasks / analytics.totalTasks) * 100}
              text={`Pending: ${analytics.pendingTasks}`}
              styles={buildStyles({
                pathColor: '#4A90E2',
                textColor: '#fff',
                trailColor: '#d6d6d6',
              })}
            />
          </div>
          <div className="flex items-center justify-center">
            <CircularProgressbar
              value={(analytics.scheduledTasks / analytics.totalTasks) * 100}
              text={`Scheduled: ${analytics.scheduledTasks}`}
              styles={buildStyles({
                pathColor: '#50E3C2',
                textColor: '#fff',
                trailColor: '#d6d6d6',
              })}
            />
          </div>
          <div className="flex items-center justify-center">
            <CircularProgressbar
              value={(analytics.completedTasks / analytics.totalTasks) * 100}
              text={`Completed: ${analytics.completedTasks}`}
              styles={buildStyles({
                pathColor: '#F5A623',
                textColor: '#fff',
                trailColor: '#d6d6d6',
              })}
            />
          </div>
          <div className="flex items-center justify-center">
            <CircularProgressbar
              value={100}
              text={`Total: ${analytics.totalTasks}`}
              styles={buildStyles({
                pathColor: '#FF6F61',
                textColor: '#fff',
                trailColor: '#d6d6d6',
              })}
            />
          </div>
        </div>
        <div className="mt-6">
          <h2 className="text-2xl font-semibold mb-4">Task List</h2>
          <table className="min-w-full bg-white text-gray-800 rounded-lg shadow-md">
            <thead>
              <tr className="border-b">
                <th className="py-2 px-4">Task Name</th>
                <th className="py-2 px-4">Description</th>
                <th className="py-2 px-4">Status</th>
                <th className="py-2 px-4">Schedule</th>
                <th className="py-2 px-4">Assigned User</th>
                <th className="py-2 px-4">Email</th>
              </tr>
            </thead>
            <tbody>
              {/* Dummy tasks data */}
              {[
                { name: 'Task 1', description: 'Description 1', status: 'Pending', schedule: '2024-08-01', user: 'User 1', email: 'user1@example.com' },
                { name: 'Task 2', description: 'Description 2', status: 'Scheduled', schedule: '2024-08-15', user: 'User 2', email: 'user2@example.com' },
              ].map((task, index) => (
                <tr key={index} className="border-b">
                  <td className="py-2 px-4">{task.name}</td>
                  <td className="py-2 px-4">{task.description}</td>
                  <td className="py-2 px-4">{task.status}</td>
                  <td className="py-2 px-4">{task.schedule}</td>
                  <td className="py-2 px-4">{task.user}</td>
                  <td className="py-2 px-4">{task.email}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      </div>
    </div>
  );
};

export default AdminDashboard;
